import React from 'react'
import { useState } from 'react'
import ApplicationPost from './ApplicationPost'

function MainLabel() {
   const dataSet = JSON.parse('../assets/data.json') 
    const [posts, setPosts] = useState(dataSet)
  return (
    <div>{posts.map((post) => 
                <ApplicationPost post = {post} key = {post.IDApplication}/>
        )}
    </div>
  )
}

export default MainLabel
